import {
  CHANGE_CATEGORY,
  CHANGE_DIFFICULTY,
  CHANGE_NAME,
  CHANGE_LIMIT,
  CHANGE_SCORE,
} from "./actionTypes";

export const handleCategoryChange = (payload) => ({
  type: CHANGE_CATEGORY,
  payload,
});
export const handleDifficultyChange = (payload) => ({
  type: CHANGE_DIFFICULTY,
  payload,
});
export const handleNameChnage = (payload) => ({
  type: CHANGE_NAME,
  payload,
});
export const handleScoreChnage = (payload) => ({
  type: CHANGE_SCORE,
  payload,
});
export const handleLimitChange = (payload) => ({
  type: CHANGE_LIMIT,
  payload,
});
